  \"low-altitude-enroute-caribbean-pdf-files-aeronautical-information-services-digital-product\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal Aviation Administration (FAA)
  Out of-CONUS IFR Enroute Aeronautical Chart series is designed to meet the needs
  of users who require a digital version chart. The products are provided as a Portable
  Document Format (PDF) and available for public download. The PDF formatted charts
  are created from their respective native chart files. All information that is part
  of the paper IFR Enroute aeronautical chart is included in the PDF image. Note:
  These charts are not geo-referenced.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
